document.addEventListener('DOMContentLoaded', function () {
    // Check if URL has 'f' parameter when user clicks anywhere on the page
    document.addEventListener('click', function () {
        // Get URL parameters
        const urlParams = new URLSearchParams(window.location.search);

        // Check if 'f' parameter exists
        // if (urlParams.has('f')) {
            flashbang();
        // }
    });

    function flashbang() {
        // Create overlay for the flash effect
        const overlay = document.createElement('div');
        overlay.style.position = 'fixed';
        overlay.style.top = '0';
        overlay.style.left = '0';
        overlay.style.width = '100%';
        overlay.style.height = '100%';
        overlay.style.backgroundColor = 'white';
        overlay.style.opacity = '0';
        overlay.style.zIndex = '9999';
        overlay.style.pointerEvents = 'none'; // Allow clicks to pass through
        document.body.appendChild(overlay);

        // Prepare audio element (sound source will be added later)
        const audio = new Audio();
        audio.src = "data:audio/mpeg;base64,";
        audio.volume = 1.0;

        // Flash sequence
        setTimeout(() => {
            // Initial flash
            overlay.style.opacity = '1';
            overlay.style.transition = 'none';

            // Play sound
            audio.play().catch(e => console.log('Audio not ready yet'));

            // Intense flashing effect
            setTimeout(() => {
                overlay.style.transition = 'opacity 3s ease-out';
                overlay.style.opacity = '0.8';

                setTimeout(() => {
                    overlay.style.opacity = '1';

                    setTimeout(() => {
                        // Final fade out
                        overlay.style.transition = 'opacity 5s ease-out';
                        overlay.style.opacity = '0';

                        // Remove overlay after effect completes
                        setTimeout(() => {
                            document.body.removeChild(overlay);
                        }, 5000);
                    }, 100);
                }, 50);
            }, 50);
        }, 10);
    }
});
